import React, { useState } from 'react';
import AIVisual from './components/AIVisual';
import './styles/animations.css';
import './styles/globals.css';

function App() {
  const [activeDropdown, setActiveDropdown] = useState(null);

  // Navigation menu structure
  const navItems = {
    Personal: [
      'Internship Journey',
      'Goals',
      'University',
      'Logbook'
    ],
    Labs: [
      'Artificial Intelligence',
      'Automation',
      'Data Visualization',
      'Brainstorming',
      'Projects'
    ],
    Research: [
      'Neural Networks',
      'Classification',
      'Regression',
      'Clustering',
      'Deep Learning'
    ],
    Contract: [
      'Details',
      'GitHub',
      'Email',
      'Resume',
      'Contact'
    ]
  };

  return (
    <div style={{
      background: 'linear-gradient(130deg, #00040F 60%, #001F3F 100%)',
      color: '#FFFFFF',
      minHeight: '100vh',
      overflow: 'hidden',
      position: 'relative',
    }}>
      {/* Animated Glowing Orbs */}
      <div className="orb orb-1" />
      <div className="orb orb-2" />
      <div className="orb orb-3" />

      <nav className="fade-in-down" style={{
        display: 'flex',
        justifyContent: 'space-between',
        alignItems: 'center',
        padding: '20px 40px',
        maxWidth: '1400px',
        margin: '0 auto',
        backgroundColor: 'rgba(0, 4, 15, 0.8)',
        backdropFilter: 'blur(8px)',
        zIndex: 10,
        position: 'relative',
      }}>
        <div className="logo-animation" style={{ 
          fontSize: '24px', 
          fontWeight: 'bold',
          display: 'flex',
          alignItems: 'center',
          gap: '8px',
        }}>
          <span style={{ color: '#5CE1E6', fontSize: '28px' }}>DS</span>
          Portfolio
        </div>
        <div className="nav-links" style={{
          display: 'flex',
          gap: '40px',
        }}>
          {Object.entries(navItems).map(([category, items]) => (
            <div
              key={category}
              className="nav-item"
              onMouseEnter={() => setActiveDropdown(category)}
              onMouseLeave={() => setActiveDropdown(null)}
              style={{ position: 'relative' }}
            >
              <a 
                href={`#${category.toLowerCase()}`}
                className="nav-link"
                style={{
                  color: activeDropdown === category ? '#5CE1E6' : '#FFFFFF',
                  transition: 'color 0.3s ease'
                }}
              >
                {category}
              </a>

              {activeDropdown === category && (
                <div className="dropdown-menu" style={{
                  position: 'absolute',
                  top: '100%',
                  left: '50%',
                  transform: 'translateX(-50%)',
                  backgroundColor: 'rgba(0, 4, 15, 0.95)',
                  backdropFilter: 'blur(8px)',
                  borderRadius: '12px',
                  padding: '12px 0',
                  minWidth: '200px',
                  boxShadow: '0 4px 20px rgba(92, 225, 230, 0.15)',
                  border: '1px solid rgba(92, 225, 230, 0.1)',
                  marginTop: '10px',
                  animation: 'fadeIn 0.3s ease',
                }}>
                  {items.map((item, index) => (
                    <a
                      key={item}
                      href={`#${item.toLowerCase().replace(/\s+/g, '-')}`}
                      className="dropdown-item"
                      style={{
                        display: 'block',
                        padding: '10px 20px',
                        color: '#FFFFFF',
                        textDecoration: 'none',
                        transition: 'all 0.3s ease',
                        animation: `fadeInUp 0.3s ease forwards ${index * 0.05}s`,
                        opacity: 0,
                      }}
                      onMouseEnter={(e) => {
                        e.target.style.backgroundColor = 'rgba(92, 225, 230, 0.1)';
                        e.target.style.color = '#5CE1E6';
                      }}
                      onMouseLeave={(e) => {
                        e.target.style.backgroundColor = 'transparent';
                        e.target.style.color = '#FFFFFF';
                      }}
                    >
                      {item}
                    </a>
                  ))}
                </div>
              )}
            </div>
          ))}
        </div>
      </nav>

      <main style={{
        maxWidth: '1400px',
        margin: '60px auto',
        padding: '0 40px',
        display: 'flex',
        justifyContent: 'space-between',
        alignItems: 'center',
        position: 'relative',
        zIndex: 1,
      }}>
        <div className="content-wrapper">
          <div className="fade-in-up badge" style={{
            backgroundColor: 'rgba(92, 225, 230, 0.1)',
            padding: '8px 16px',
            borderRadius: '20px',
            display: 'inline-block',
            marginBottom: '24px',
            border: '1px solid rgba(92, 225, 230, 0.2)',
            backdropFilter: 'blur(4px)',
          }}>
            <span style={{ color: '#5CE1E6' }}>ðŸ“Š Data Science Intern</span>
          </div>

          <h1 className="slide-in-left" style={{
            fontSize: '72px',
            lineHeight: '1.1',
            marginBottom: '24px',
          }}>
            The Next
            <br />
            <span className="glow-text">Generation</span>
            <br />
            Data Science.
          </h1>

          <p className="fade-in-up delay-2" style={{
            color: 'rgba(255, 255, 255, 0.7)',
            fontSize: '18px',
            lineHeight: '1.6',
            marginBottom: '40px',
            maxWidth: '470px',
          }}>
            Passionate about machine learning, statistical analysis, and data visualization.
            Focused on extracting meaningful insights from complex datasets.
          </p>

          <div className="fade-in-up delay-3" style={{
            display: 'flex',
            gap: '20px',
          }}>
            <a href="#projects" className="button-primary">View Projects</a>
            <a href="#analysis" className="button-secondary">See Analysis</a>
          </div>
        </div>

        <div className="fade-in-right">
          <AIVisual />
        </div>
      </main>
    </div>
  );
}

export default App;
